import React, { useState } from "react";
import SideBar from '../sideBar/sideBard';
import Avatar from './avatar/avatar';


export default function NavBar() {
  const [open, setOpen] = useState(false);
  const HandleOpen = () => {
    setOpen(!open);
  };

  return (
    <nav className="flex flex-row w-full lg:mx-20  justify-between">
      <div className='lg:text-xl  mt-1 text-base text-white font-bold '><h3>Delivery 2.0</h3></div>
      <div>
        <Avatar HandleOpen={HandleOpen} />
        <SideBar open={open}/>
      </div>
    </nav>
  );
}
